import React from 'react';

const ImageGallery = ({ images, selectedIndex }) => {
    return (
        <div className="image-gallery">
            <img src={images[selectedIndex]}
                alt={`${selectedIndex + 1}`}
            />
        </div>
    );
};

export default ImageGallery;
